        left: '50%',
        right: 'auto',
        bottom: 'auto',
        marginRight: '-50%',
        transform: 'translate(-50%, -50%)',
        padding: "50px",
        height: "600px",
        background: "#efefef",
        border: "2px solid #8f8f8f"
    },
};

const CssClasses = {
    BUTTON: "orders-list__button--close",
}

const AdminModal = ({modalIsOpen, closeModal, item}) => {

    function handleCloseModal() {
        closeModal(false)
    }

    console.log(item)

    return (
        <Modal isOpen={modalIsOpen}
               onRequestClose={closeModal}
               style={customStyles}
        >
            <p>{item.name}</p>
        </Modal>

    );
};

export default AdminModal;
